svg.script:
var clock = {
    coeur: 100,
    heure: 0,
    minute: 0,
    seconde: 0,
    point: 0,
    init: function( rev ) {
        this.tictac();
        var encours = new Date().getTime();
        var tempo = this.coeur - (encours % this.coeur);
        setTimeout( function() { clock.start() }, tempo );
    },
    start: function() {
        this.tictac();
        setInterval( function() { clock.tictac() }, this.coeur );
    },

    tictac: function() {
        var tpscour = new Date();
        this.set_seconde(tpscour.getSeconds());
        this.set_minute(tpscour.getMinutes());
        this.set_heure(tpscour.getHours());

//	var temps = tpscour.getHours() + ":" + tpscour.getMinutes() + ":" + tpscour.getSeconds();
//	var temps = tpscour.toTimeString().substring(0,8);
//	var svgText = document.getElementById("tspanheure").firstChild;

//      svgText.nodeValue = temps;

    },

    set_seconde: function (sec) {
        if (sec === this.seconde) {
            return;
        }
        if (this.point === 0) {
	  this.showLayer("CHPointC");
	  this.point = 1;}
	else {
          this.hideLayer("CHPointC");
	  this.point = 0;
	}

        if (sec < 10) {
	  this.sacreParseur (0, "SD"); 
 	  this.sacreParseur (sec, "SU");}
	else {
	  this.sacreParseur (sec/10, "SD");
  	  this.sacreParseur (sec%10, "SU");
        }
        this.seconde = sec;
    },

    set_minute: function(min) {
        if (min === this.minute) {
            return;
        }

	if (min < 10) {
          this.sacreParseur (0, "MD"); 
          this.sacreParseur (min, "MU");}
	else {
          this.sacreParseur (min/10, "MD"); 
          this.sacreParseur (min%10, "MU");
	}
        this.minute = min;
    },

    set_heure: function(hr) {
        if (hr === this.heure) {
            return;
        }
        // Sur 12 heures ?
        // hr %= 12;
        // hr += this.minute/60;
	if (hr < 10) {
          this.sacreParseur (0, "HD"); 
          this.sacreParseur (hr, "HU");	}
	else {
          this.sacreParseur (hr/10, "HD");
          this.sacreParseur (hr%10, "HU");
	}

        this.heure = hr;
    },

    showLayer: function(layerid){
	document.getElementById(layerid).style.display="inline";
    },

    hideLayer: function(layerid){
	document.getElementById(layerid).style.display="none";
    },

    sacreParseur: function(c,quid) {
	if (quid[1]=="U") {this.hideLayer("CH"+quid+"8C")};
	switch (parseInt(c)) { 
	  case 1: if (quid!=="HD") {this.hideLayer("CH"+quid+"4C")}; this.showLayer("CH"+quid+"1C");this.hideLayer("CH"+quid+"2C"); break;
	  case 2: if (quid!=="HD") {this.hideLayer("CH"+quid+"4C")};this.hideLayer("CH"+quid+"1C");this.showLayer("CH"+quid+"2C"); break;
	  case 3: this.showLayer("CH"+quid+"1C");this.showLayer("CH"+quid+"2C");this.hideLayer("CH"+quid+"4C"); break;
	  case 4: this.hideLayer("CH"+quid+"1C");this.hideLayer("CH"+quid+"2C");this.showLayer("CH"+quid+"4C"); break;
	  case 5: this.showLayer("CH"+quid+"1C");this.hideLayer("CH"+quid+"2C");this.showLayer("CH"+quid+"4C"); break;
	  case 6: this.hideLayer("CH"+quid+"1C");this.showLayer("CH"+quid+"2C");this.showLayer("CH"+quid+"4C"); break;
	  case 7: this.showLayer("CH"+quid+"1C");this.showLayer("CH"+quid+"2C");this.showLayer("CH"+quid+"4C"); break;
	  case 8: this.hideLayer("CH"+quid+"1C");this.hideLayer("CH"+quid+"2C");this.hideLayer("CH"+quid+"4C"); this.showLayer("CH"+quid+"8C"); break;
	  case 9: this.showLayer("CH"+quid+"8C");this.showLayer("CH"+quid+"1C");this.hideLayer("CH"+quid+"2C");this.hideLayer("CH"+quid+"4C"); break;
	  default: if (quid!=="HD") {this.hideLayer("CH"+quid+"4C")};this.hideLayer("CH"+quid+"1C");this.hideLayer("CH"+quid+"2C");
	}
    },
};

	function play() { 
	  clock.init(); 
	}
